import React, { Fragment } from "react";

class ProductList extends React.Component{
    constructor(props){
        super(props)
    }

    render(){
        return(
            <Fragment>
                <div className="container">
                    <div className="row">
                        <div className="col">
                            <p className="h3 text-success">Products List</p>
                        </div>
                    </div>
                </div>
            </Fragment>
        )
    }
}

export default ProductList
